<?php

include_once 'Sample_Header.php';

use PhpOffice\PhpPresentation\PhpPresentation;
use PhpOffice\PhpPresentation\Shape\Drawing;
use PhpOffice\PhpPresentation\Shape\Media;

// Create new PHPPresentation object
echo date('H:i:s') . ' Create new PHPPresentation object'.EOL;
$objPHPPresentation = new PhpPresentation();

// Create slide
echo date('H:i:s') . ' Create slide'.EOL;
$currentSlide = $objPHPPresentation->getActiveSlide();

// Generate an image
echo date('H:i:s') . ' Generate an image'.EOL;
$gdImage = @imagecreatetruecolor(140, 20) or die('Cannot Initialize new GD image stream');
$textColor = imagecolorallocate($gdImage, 255, 255, 255);
imagestring($gdImage, 1, 5, 5,  'Created with PHPPresentation', $textColor);

// Add a generated drawing to the slide
echo date('H:i:s') . ' Add a drawing to the slide'.EOL;
$shape = new Drawing\Gd();
$shape->setName('Sample image')
      ->setDescription('Sample image')
      ->setImageResource($gdImage)
      ->setRenderingFunction(Drawing\Gd::RENDERING_JPEG)
      ->setMimeType(Drawing\Gd::MIMETYPE_DEFAULT)
      ->setHeight(36)
      ->setOffsetX(10)
      ->setOffsetY(10);
$currentSlide->addShape($shape);

// Add a file drawing (GIF) to the slide
$shape = new Drawing\File();
$shape->setName('PHPPresentation logo')
    ->setDescription('PHPPresentation logo')
    ->setPath('./resources/phppowerpoint_logo.gif')
    ->setHeight(36)
    ->setOffsetX(10)
    ->setOffsetY(100);
$currentSlide->addShape($shape);

// Add a file drawing (Zip) to the slide
$shape = new Drawing\ZipFile();
$shape->setName('PHPPresentation logo')
    ->setDescription('PHPPresentation logo')
    ->setPath('zip://./resources/Sample_12.pptx#ppt/media/phppowerpoint_logo1.gif')
    ->setResizeProportional(false)
    ->setHeight(36)
    ->setWidth(36)
    ->setOffsetX(10)
    ->setOffsetY(150);
$currentSlide->addShape($shape);

// Add a file drawing (JPEG) to the slide
$shape = new Drawing\Base64();
$shape->setName('PHPPresentation logo')
    ->setDescription('PHPPresentation logo')
    ->setData('data:image/jpeg;base64,', false)
    ->setResizeProportional(false)
    ->setHeight(36)
    ->setWidth(36)
    ->setOffsetX(10)
    ->setOffsetY(200);
$currentSlide->addShape($shape);

// Add a video to the slide
$shape = new Media();
$shape->setName('Video')
    ->setDescription('Video')
    ->setPath(strtoupper(substr(PHP_OS, 0, 3)) === 'WIN' ? './resources/sintel_trailer-480p.wmv' : './resources/sintel_trailer-480p.ogv')
    ->setResizeProportional(false)
    ->setHeight(90)
    ->setWidth(90)
    ->setOffsetX(10)
    ->setOffsetY(300);
$currentSlide->addShape($shape);

// Save file
echo write($objPHPPresentation, basename(__FILE__, '.php'), $writers);
if (!CLI) {
	include_once 'Sample_Footer.php';
}
